import TextField from '@material-ui/core/TextField';
import Autocomplete from '@material-ui/lab/Autocomplete';
import FlightTakeoffIcon from '@material-ui/icons/FlightTakeoff';
import FlightLandIcon from '@material-ui/icons/FlightLand';

const cities = [
    "Paris",
    "London"];

function SearchBarContainer() {
    return <div class="container">
    <div class="row justify-content-center">
    <FlightTakeoffIcon />
    <Autocomplete
      name="comingFromSearchBar"
      id="comingFromSearchBar"
      options={cities}
      getOptionLabel={(option) => option}
      style={{ width: 300 }}
      renderInput={(params) => <TextField {...params} label="Origin city" variant="outlined" />}
    />
    <Autocomplete
      name="goingToSearchBar"
      id="goingToSearchBar"
      options={cities}
      getOptionLabel={(option) => option}
      style={{ width: 300 }}
      renderInput={(params) => <TextField {...params} label="Desination city" variant="outlined" />}
    />
    <FlightLandIcon />
    </div>
    </div>
}

export default SearchBarContainer;
